import React, { Component } from "react";

export class index extends Component {
  constructor(props) {
    super(props);

    this.state = {
      w: "",
      bAccRow: false
    };
  }

  render() {
    return (
      <div>
        <table className="table fixed-table-head table-bordered">
          <thead>
            <tr>
              {this.props.head.map(x => (
                <th key={x.id} style={{ width: x.width }}>
                  {x.title}
                </th>
              ))}
            </tr>
          </thead>
        </table>
        <table className="table table-bordered user-table">
          <tbody>
            {this.props.body.map(x => (
              <tr>
                <td key={x.id}>{x.firstName}</td>
                <td>{x.lastName}</td>
                <td>{x.email}</td>
                <td>{x.contact}</td>
                <td>{x.facebookID}</td>
                <td style={{ width: this.props.head[0].width }}>
                  {x.googleID}
                </td>
                <td style={{ width: x.creditsWidth }}>{x.credits}</td>
                <td style={{ width: x.timestampWidth }}>{x.timestamp}</td>
                {/* {!x.email ? (
                  <td key={x.id} style={{ display: "none" }} />
                ) : (
                  <td >{x.email}</td>
                )}
                {!x.username ? (
                  <td key={x.id} style={{ display: "none" }} />
                ) : (
                  <td style={{ width: x.usernameWidth }}>{x.username}</td>
                )}
                {!x.date ? (
                  <td key={x.id} style={{ display: "none" }} />
                ) : (
                  <td>{x.date}</td>
                )} */}
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    );
  }
}

export default index;
